-- Minimum participation ckeck on : T1962
CREATE OR REPLACE FUNCTION "ONTORELA".T1962_checkParticipationMin(_T04dc_uid "ONTORELA"."uid_domain")
  RETURNS BOOLEAN AS
$$
BEGIN
  IF
  (
    (
      SELECT COUNT(*)
      FROM "ONTORELA"."T1962"
      WHERE "T04dc_uid" = _T04dc_uid
    ) >= 1
  )
  THEN
    RETURN TRUE;
  ELSE
    RAISE NOTICE 'Participation  %  does not respect minimum value %', 'T1962', 1;
    RETURN FALSE;
  END IF;
END;
$$
LANGUAGE 'plpgsql';

